import React, { useState } from "react";
import "./style.css";
import { VscGrabber, VscClose } from "react-icons/vsc";
import { Link } from "react-router-dom";
import { logotext, socialprofils, logo } from "../content_option";
import Themetoggle from "../components/themetoggle";
import { FaHome, FaProjectDiagram, FaUser, FaFileAlt, FaEnvelope } from "react-icons/fa";

const Headermain = () => {
  const [isActive, setActive] = useState("false");

  const handleToggle = () => {
    setActive(!isActive);
    document.body.classList.toggle("ovhidden");
  };

  return (
    <>
      <header className="fixed-top site__header">
        <div className="d-flex align-items-center justify-content-between">
          <Link className="navbar-brand nav_ac d-flex align-items-center" to="/">
            {/* <img
              src={logo}
              alt="Logo"
              style={{ width: "40px", height: "40px", objectFit: "contain", marginRight: "8px" }}
            /> */}
            <img
  src={logo}
  alt="Logo"
  style={{
    width: "60px",
    height: "60px",
    borderRadius: "50%",
    objectFit: "cover",
    boxShadow: "0 4px 10px rgba(0, 0, 0, 0.1)",
    marginRight: "10px",
  }}
/>

            {logotext}
          </Link>

          <div className="d-flex align-items-center">
            <Themetoggle />
            <button className="menu__button nav_ac" onClick={handleToggle}>
              {!isActive ? <VscClose /> : <VscGrabber />}
            </button>
          </div>
        </div>

        <div className={`site__navigation ${!isActive ? "menu__opend" : ""}`}>
          <div className="bg__menu h-100">
            <div className="menu__wrapper">
              <div className="menu__container p-3">
                <ul className="the_menu">
                  <li className="menu_item">
                    <Link onClick={handleToggle} to="/" className="my-3 d-flex align-items-center">
                      <FaHome className="me-2" /> Home
                    </Link>
                  </li>
                  <li className="menu_item">
                    <Link onClick={handleToggle} to="/projects" className="my-3 d-flex align-items-center">
                      <FaProjectDiagram className="me-2" /> Projects
                    </Link>
                  </li>
                  <li className="menu_item">
                    <Link onClick={handleToggle} to="/about" className="my-3 d-flex align-items-center">
                      <FaUser className="me-2" /> About
                    </Link>
                  </li>
                  <li className="menu_item">
                    <Link onClick={handleToggle} to="/resume" className="my-3 d-flex align-items-center">
                      <FaFileAlt className="me-2" /> Resume
                    </Link>
                  </li>
                  <li className="menu_item">
                    <Link onClick={handleToggle} to="/contact" className="my-3 d-flex align-items-center">
                      <FaEnvelope className="me-2" /> Get in touch with
                    </Link>
                  </li>
                </ul>

              </div>
            </div>
          </div>
          <div className="menu_footer d-flex flex-column flex-md-row justify-content-between align-items-md-center position-absolute w-100 p-3">
            <div className="d-flex">
              {/* <a href={socialprofils.facebook}>Facebook</a> */}
              <a href={socialprofils.github}>Github</a>
              {/* <a href={socialprofils.twitter}>Twitter</a> */}
            </div>
            <p className="copyright m-0">copyright __ {logotext}</p>
          </div>
        </div>
      </header>
      <div className="br-top"></div>
      <div className="br-bottom"></div>
      <div className="br-left"></div>
      <div className="br-right"></div>

    </>
  );
};

export default Headermain;
